    true,nt"url": null,nt"notes": "<p>The Insure Kids Now (IKN) Dental Care
    Providers in Your State locator tool is provided, in accordance with the Children's
    Health Insurance Program Reauthorization Act of 2009 (CHIPRA) and the Centers for
    Medicare and Medicaid Services (CMS) in order to make available via the IKN website:
    (1) profile information for each oral health provider participating in Medicaid
    and Children's Health Insurance Program (CHIP); and (2) description of oral health
    services covered under each Medicaid/CHIP plan. Current and prospective beneficiaries
    can now use this website to search for providers and learn about Programs/Health
    Plans offered in their resident State. The data for this application is updated
    at least on a quarter-annual basis.</p>n",nt"owner_org": "3609164c-4c49-4a44-9179-23163027dc0a",nt"extras":
